import React from 'react';
import Particles from 'react-tsparticles';
import { loadFull } from 'tsparticles';

function ParticleBackground() {
	const particlesInit = async (main) => {
		// console.log(main);
		await loadFull(main);
	};

	const particlesLoaded = (container) => {
		// console.log(container);
	};
	return (
		<div className="particles">
			<Particles
				id="tsparticles"
				init={particlesInit}
				loaded={particlesLoaded}
				options={{
					fpsLimit: 120,
					// interactivity: {
					// 	events: {
					// 		onClick: {
					// 			enable: false,
					// 			mode: 'push',
					// 		},
					// 		onHover: {
					// 			enable: true,
					// 			mode: 'repulse',
					// 		},
					// 		resize: true,
					// 	},
					// 	modes: {
					// 		push: {
					// 			quantity: 4,
					// 		},
					// 		repulse: {
					// 			distance: 200,
					// 			duration: 0.4,
					// 		},
					// 	},
					// },
					particles: {
						color: {
							value: '#ffffff',
						},
						links: {
							color: '#ffffff',
							distance: 150,
							enable: true,
							opacity: 0.5,
							width: 2,
						},
						collisions: {
							enable: true,
						},
						move: {
							direction: 'none',
							enable: true,
							outModes: {
								default: 'bounce',
							},
							random: false,
							speed: 1.5,
							straight: false,
						},
						number: {
							density: {
								enable: true,
								area: 800,
							},
							value: 80,
						},
						opacity: {
							value: 0.5,
						},
						shape: {
							type: 'circle',
						},
						size: {
							value: { min: 1, max: 5 },
						},
					},
					detectRetina: true,
				}}
			/>
		</div>
	);
}

export default ParticleBackground;
